import React from 'react'
import PayWithPayPal from './Payment/PayWithPayPal'
import styled from 'styled-components';

const StyledDonations = styled.div`
    margin-top: 30px;

    @media (max-width: 768px) {
      
    }

    div {
        width: 330px;
        margin:0 auto;
    }
    
`

function Donations() {
    return (
        <StyledDonations>
            <div>
                <PayWithPayPal items={[{name:'test', value:100.10}]} total={1000} />
            </div>
            <div>
                <PayWithPayPal items={[{name:'test2', value:99.10}]} total={999} />
            </div>
            
        </StyledDonations>
    )
}

export default Donations
